div.div:
Внутри тела цикла есть возможность управлять его выполнением. Достигается это при помощи ключевых слов break и continue.
break выводит поток выполнения из цикла.
Ex. int a = 0;
for (int i = 0; i < 1000; ++i) {
if (i == 5) {
break; // весь цикл завершится как только i == 5
}
}
continue выводит поток выполнения на новую итерацию.
Ex. int a = 0;
for (int i = 0; i < 10; ++i) {
if (i == 5) {
continue; // цикл прервет текующую итерацию
}
std::cout << i << ' ';
}
std::cout << std::endl; // выведет числа от 0 до 10 кроме 5
